import { Component } from "react";

import React from 'react';
import PropTypes from 'prop-types';
import 'antd/dis/antd.css';

const App = ({ Component }) => {
  return (
    <Component />
  );
}

App.propTypes = {
  Component: PropTypes.elementType.isRequired
}

export default App;
